import React from 'react';

function HomePage() {
    return (
        <div style={{ textAlign: 'center', marginTop: '50px' }}>
            <h1>Welcome to My Goals App</h1>
            <p>Navigate to the "Goals" page to manage your goals!</p>
        </div>
    );
}

export default HomePage;
